pub enum Expected {
    Any(&'static [usize]),
    Exact(usize),
    Range {
        min: usize,
        max: usize,
    },
}

pub enum ParseError {
    InvalidCharacter {
        expected: &'static str,
        found: char,
        index: usize,
    },
    InvalidGroupCount {
        expected: Expected,
        found: usize,
    },
    InvalidGroupLength {
        expected: Expected,
        found: usize,
        group: usize,
    },
    InvalidLength {
        expected: Expected,
        found: usize,
    },
}
